package main

import (
	"bytes"
	"crypto/md5"
	"encoding/base64"
	"fmt"
	"image"
	"image/jpeg"
	"log"
	"os"

	"github.com/forgoer/openssl"
)

func main() {
	payload := ""
	strData, err := DecryptData(payload)
	if err != nil {
		fmt.Println(err.Error())
	} else {
		fmt.Println("String Data:", strData)

	}

}

func DecryptData(input string) (string, error) {
	keytsel := []byte("t3Lk0MseL.c0m321")

	value, err := base64.StdEncoding.DecodeString(input)
	if err != nil {
		return "", err
	}
	h := md5.New()
	h.Write(keytsel)
	key := []byte(string(h.Sum(nil)))
	dst, err := openssl.AesECBDecrypt(value, key, openssl.PKCS7_PADDING)
	if err != nil {
		return "", err
	}
	// WriteImage(dst)
	d := string(dst)
	// fmt.Println(d)
	if len(d) >= 1 {
		if d[0] == '"' && d[len(d)-1] == '"' {
			return (d[1 : len(d)-1]), nil
		}
	}
	// value2, _ := base64.StdEncoding.DecodeString(input)
	// WriteImage(value2)
	return (d[1 : len(d)-1]), nil
}
func WriteImage(imgByte []byte) {
	img, _, err := image.Decode(bytes.NewReader(imgByte))
	if err != nil {
		log.Fatalln(err)
	}

	out, _ := os.Create("./img.png")
	defer out.Close()

	var opts jpeg.Options
	opts.Quality = 1

	err = jpeg.Encode(out, img, &opts)

	if err != nil {
		log.Println(err)
	}
}
